rawText:
 (props) => {
  const {
    subwordConfig,
    markdownFileConfig,
    subtextConfig,
    markedToken,
    testModeEnabled,
  } = props;

  const sentences = markedToken.raw.split("\n");
  return (
    <div>
      {sentences.map((sentence) => (
        <div>
          <SpannedSentence
            sentence={sentence}
            subwordConfig={subwordConfig}
            markdownFileConfig={markdownFileConfig}
            subtextConfig={subtextConfig}
            testModeEnabled={testModeEnabled}
          />
        </div>
      ))}
    </div>
  );
}
